  const videoJsOptions = {
    autoplay: true, // Enable autoplay
    controls: false, // Hide video controls
    loop: true, // Enable looping
    sources: [
      {
        src: {profilevideo}, // Replace with the actual path to your video file
        type: 'video/mp4', // Replace with the actual video type
      },
    ],
  };

  return (
    <>
    <body>
      <div className='sign'>
        <VideoPlayer>

        </VideoPlayer>
        <img src={pic} alt="" className="pic" />
        <h2>User</h2>
        <Link to="/navbar"><button>Sign In</button></Link>
      </div>
    </body>
    </>
  )
}
